import React from 'react';
import ReactDOM from 'react-dom';
import Cards from './Cards';
import Sdata from './Sdata';


ReactDOM.render(
  <>
  <Cards
    snam = {Sdata[0].sname}
    titl = {Sdata[0].title}
  />
  <Cards
    snam = {Sdata[1].sname}
    titl = {Sdata[1].title}
  />
  </>,document.getElementById('root')

  );
